        isHoveredImage: false
    }

    render() {
        return (

            <div className={styles.projectsSection}>
                <span className={styles.sectionTitle}>
                    <Fade bottom>
                        Contact:
                            </Fade>
                </span>

            </div>
        )
    }
}

